import React, { Component } from 'react';
import './style.css';
import { connect } from 'react-redux';

class Main extends Component {
  constructor(props) {
    super(props);
    this.state = {
      team: ""
    };
  }
fixAllColor=()=>{
  
  document.getElementById("All_btn").style.backgroundColor="transparent";
  document.getElementById("All_btn").style.color="rgb(188, 188, 185)";
  document.getElementById("HTML_btn").style.backgroundColor="transparent";
  document.getElementById("HTML_btn").style.color="rgb(188, 188, 185)";
  document.getElementById("photo_btn").style.backgroundColor="transparent";
  document.getElementById("photo_btn").style.color="rgb(188, 188, 185)";
  document.getElementById("CSS_btn").style.backgroundColor="transparent";
  document.getElementById("CSS_btn").style.color="rgb(188, 188, 185)";
  document.getElementById("MOBILE_btn").style.backgroundColor="transparent";
  document.getElementById("MOBILE_btn").style.color="rgb(188, 188, 185)";
}
  GetAll = () => {
    this.setState({ team: "All" });
  };
  GetHTML = () => {
    this.setState({ team: "HTML" });
  };
  GetPhotoShop = () => {
    this.setState({ team: "PhotoShop" });
  };
  GetCSS = () => {
    this.setState({ team: "CSS" });
  };
  GetMOBILE = () => {
    this.setState({ team: "MOBILE" });
  };

  render() {
    let content = this.props.All.map((obj) => (
      <div className='img-container' >
        <div className='img-orange-container'>
          <p>
            <h2>UX DESIGN</h2>
            Lorem ipsum dolor sit amet consectetur, adipisicing elit. Libero, eum cumque!
          </p>
        </div>
        <img src={obj.imgUrl} alt={obj.name} />
      </div>
    ));

    if (this.state.team === "All") {
      this.fixAllColor();
      document.getElementById("All_btn").style.backgroundColor="#eb5424";
      document.getElementById("All_btn").style.color="white";
      content = this.props.All.map((obj) => (
        <div className='img-container' >
          <div className='img-orange-container'>
            <p>
              <h2>UX DESIGN</h2>
              Lorem ipsum dolor sit amet consectetur, adipisicing elit. Libero, eum cumque!
            </p>
          </div>
          <img src={obj.imgUrl} alt={obj.name} />
        </div>
      ));
    } else if (this.state.team === "HTML") {
      this.fixAllColor();
      document.getElementById("HTML_btn").style.backgroundColor="#eb5424";
      document.getElementById("HTML_btn").style.color="white";
      content = this.props.HTML.map((obj) => (
        <div className='img-container' >
          <div className='img-orange-container'>
            <p>
              <h2>UX DESIGN</h2>
              Lorem ipsum dolor sit amet consectetur, adipisicing elit. Libero, eum cumque!
            </p>
          </div>
          <img src={obj.imgUrl} alt={obj.name} />
        </div>
      ));
    } else if (this.state.team === "CSS") {
      this.fixAllColor();
      document.getElementById("CSS_btn").style.backgroundColor="#eb5424";
      document.getElementById("CSS_btn").style.color="white";
      content = this.props.CSS.map((obj) => (
        <div className='img-container' >
          <div className='img-orange-container'>
            <p>
              <h2>UX DESIGN</h2>
              Lorem ipsum dolor sit amet consectetur, adipisicing elit. Libero, eum cumque!
            </p>
          </div>
          <img src={obj.imgUrl} alt={obj.name} />
        </div>
      ));
    } else if (this.state.team === "PhotoShop") {
      this.fixAllColor();
      document.getElementById("photo_btn").style.backgroundColor="#eb5424";
      document.getElementById("photo_btn").style.color="white";
      content = this.props.PhotoShop.map((obj) => (
        <div className='img-container' >
          <div className='img-orange-container'>
            <p>
              <h2>UX DESIGN</h2>
              Lorem ipsum dolor sit amet consectetur, adipisicing elit. Libero, eum cumque!
            </p>
          </div>
          <img src={obj.imgUrl} alt={obj.name} />
        </div>
      ));
    } else if (this.state.team === "MOBILE") {
      this.fixAllColor();
      document.getElementById("MOBILE_btn").style.backgroundColor="#eb5424";
      document.getElementById("MOBILE_btn").style.color="white";
      content = this.props.MOBILE.map((obj) => (
        <div className='img-container' >
          <div className='img-orange-container'>
            <p>
              <h2>UX DESIGN</h2>
              Lorem ipsum dolor sit amet consectetur, adipisicing elit. Libero, eum cumque!
            </p>
          </div>
          <img src={obj.imgUrl} alt={obj.name} />
        </div>
      ));
    }

    return (
      <React.Fragment>
        <p id='portfolio_p'>MY <b>PORFOLIO</b></p>
        <div className='main-container'>
          <div className='btn-group'>
            <button id='All_btn' onClick={this.GetAll}>ALL</button>
            <button id='HTML_btn' onClick={this.GetHTML}>HTML</button>
            <button id='photo_btn' onClick={this.GetPhotoShop}>PhotoShop</button>
            <button id='CSS_btn' onClick={this.GetCSS}>CSS</button>
            <button id='MOBILE_btn' onClick={this.GetMOBILE}>MOBILE</button>
          </div>
        </div>
        <div className='porfolio-img-container'>{content}</div>
      </React.Fragment>
    );
  }
}

const MapStateToProps = (state) => {
  return {
    All: state.All,
    HTML: state.HTML,
    PhotoShop: state.PhotoShop,
    CSS: state.CSS,
    MOBILE: state.MOBILE
  };
};

const MapDispatchToProps = (dispatch) => {
  return {};
};

export default connect(MapStateToProps, MapDispatchToProps)(Main);
